function ItemAdd(btnAdd) {
  return(  <div className="col d-flex align-items-center">
    <a onClick={() => (s) => btnAdd(s)} className="btn btn-warning btn-count"><i className="fas fa-minus"></i></a>
  </div>
  )
};

